pragma solidity ^0.6.0;

import "./Crowdsale.sol";
import "./KycContract.sol";

contract TriganDaoERC20ForSale is Crowdsale {
    using SafeMath for uint256;

    KycContract internal _kyc;

    constructor(
        uint256 rate,    // rate in TKNbits, read more at https://docs.openzeppelin.com/contracts/2.x/crowdsales
        address payable wallet,
        IERC20 token,
        KycContract kyc
    )
        Crowdsale(rate, wallet, token)
        public
    {
        _kyc = kyc;
    }

    function _preValidatePurchase(address beneficiary, uint256 weiAmount) internal view override {
        super._preValidatePurchase(beneficiary, weiAmount);
        require(_kyc.kycStatus(msg.sender), "KYC is not completed, purchase is prohibited");
    }
}
